window.bookSummaryJSON = "<p>Kaye is used to drifting from place to place with her mother’s rock band, until an ominous attack forces them back to her childhood home. Kaye’s always had the unique ability to see faeries, so when she stumbles upon an injured faerie knight in the woods, she decides to save him.</p> <p>But this fateful choice has dire consequences, as she soon finds herself the unwilling pawn in an ancient and violent power struggle between two rival faerie kingdoms. Will Kaye escape with her life?</p>"; 
